create procedure branch_info_name(in branch_id int)
begin
declare admin_at char(10);
declare admin_at_1 char(10);
declare admin_type varchar(20);
DECLARE flag int;

DECLARE cursor_1 CURSOR for
select adm_AT from admin 
inner join manages on adm_AT=mng_adm_AT
inner join branch on br_code=mng_br_code
where br_code=branch_id;
declare continue handler for not found set flag=1;
open cursor_1;
set flag=0;
repeat
	fetch cursor_1 into admin_at;
	if(flag=0) then
		select adm_type into admin_type from admin where adm_AT=admin_at;
		if(admin_type='ADMINISTRATIVE') then
			select admin_at into admin_at_1;
		end if;
	end if;
	until flag=1
end repeat;
close cursor_1;

select wrk_name,wrk_lname from worker where wrk_AT=admin_at_1;

end$

