create procedure branch_info_reservations(in branch_id int)
begin
declare trip_id int;
declare reservations int;
declare flag int;
declare counter int;
declare revenue float;
declare cost float;

declare cursor_1 CURSOR for
select tr_id from trip where tr_br_code=branch_id;
declare continue handler for not found set flag=1;
open cursor_1;
set reservations=0;
set revenue=0;
set flag=0;
repeat
	fetch cursor_1 into trip_id;
	if(flag=0) then
		select tr_cost into cost from trip where trip_id=tr_id;
		select count(*) into counter from reservation where res_tr_id=trip_id;
		set reservations=counter+reservations;
		set revenue=(counter*cost)+revenue;
	end if;
	until flag=1
end repeat;
close cursor_1;

select reservations,revenue;

end$

