create procedure branch_info_salaries(in branch_id int)
begin
declare salaries float;
declare flag int;
declare salary float; 
declare worker_at char(10);

declare cursor_1 CURSOR for
select wrk_AT from worker where wrk_br_code=branch_id;
declare continue handler for not found set flag=1;
open cursor_1;
set salary=0;
set salaries=0;
set flag=0;
repeat
	FETCH cursor_1 into worker_at;
	if(flag=0) then
		select wrk_salary into salary from worker where wrk_AT LIKE worker_at;
		set salaries=salary+salaries;
		end if;
	until flag=1
end repeat;
close cursor_1;

select salaries;
end$

