CREATE PROCEDURE checktripinfo(IN br_id INT(11),IN s DATE,IN e DATE)
BEGIN
    DECLARE cost INT(11);
    DECLARE available INT(11);
    DECLARE maxseats INT(11);
    DECLARE flag INT;
    DECLARE departure DATE;
    DECLARE returning DATE;
    DECLARE reservations INT(11);
    DECLARE driver_name CHAR(20);
    DECLARE driver_lastname CHAR(20);
    DECLARE guide_name CHAR(20);
    DECLARE guide_lastname CHAR(20);
    
    DECLARE curs CURSOR FOR
    SELECT tr_cost,tr_maxseats,count(res_tr_id),(tr_maxseats - count(res_tr_id)),
    d.wrk_name AS driver_name,d.wrk_lname AS driver_lastname,g.wrk_name AS guide_name,g.wrk_lname AS guide_lastname,
    tr_departure,tr_return FROM trip LEFT JOIN reservation ON res_tr_id=tr_id 
    INNER JOIN worker g ON tr_gui_AT=g.wrk_AT INNER JOIN worker d ON tr_drv_AT=d.wrk_AT WHERE tr_br_code=br_id   GROUP BY tr_id;
    
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET flag=1;
    
    OPEN curs;
    SET flag=0;
    
    REPEAT
        FETCH curs INTO cost,maxseats,reservations,available,driver_name,driver_lastname,guide_name,guide_lastname,departure,returning;
        IF(flag=0)
        THEN
            IF(s<departure AND e>departure)
            THEN
                SELECT cost,maxseats,reservations,available,driver_name,driver_lastname,guide_name,guide_lastname,departure,returning;
            END IF;
        END IF;
        UNTIL(flag=1)
    END REPEAT;
END$
                
                
DELIMITER ;




