CREATE PROCEDURE checkadmin(IN name VARCHAR(20),IN lname VARCHAR(20))
BEGIN
    DECLARE id CHAR(10);
    DECLARE flag INT;
    DECLARE counter INT;    
    DECLARE curs CURSOR FOR
    SELECT wrk_AT FROM worker WHERE wrk_name=name AND wrk_lname=lname;
    
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET flag=1;
    
    OPEN curs;
    SET flag=0;
    SET counter=0;
    REPEAT 
        FETCH curs INTO id;
        IF(flag=0)
        THEN
            SELECT count(gui_AT) INTO counter FROM guide WHERE gui_AT=id;
            IF(counter>0)
            THEN
                DELETE FROM worker WHERE wrk_AT=id;
            END IF;
            SELECT count(drv_AT) INTO counter FROM driver WHERE drv_AT=id;
            IF (counter>0)
            THEN
                DELETE FROM worker WHERE wrk_AT=id;
            END IF;
            SELECT count(adm_AT) INTO counter FROM admin WHERE adm_AT=id AND adm_type='ADMINISTRATIVE';
            IF(counter>0)
            THEN
                SIGNAL SQLSTATE '45000'
                SET MESSAGE_TEXT= 'YOU CANT DELETE AN ADMIN.';
            END IF;
            SELECT count(adm_AT) INTO counter FROM admin 
            WHERE adm_AT=id AND (adm_type='LOGISTICS' OR adm_type='ACCOUNTING');
            IF (counter>0)
            THEN
                DELETE FROM worker WHERE wrk_AT=id;
            END IF;
        END IF;
        UNTIL(flag=1)
    END REPEAT;
END$

DELIMITER ;

