CREATE PROCEDURE returnnames(IN lastname CHAR(20))
BEGIN
    DECLARE flag INT;
    DECLARE name CHAR(20);
    DECLARE lname CHAR(20);
    DECLARE offer INT;
    DECLARE counter INT;
    DECLARE numb INT;
    SET counter=0;
    SELECT MAX(res_offer_id) INTO numb FROM reservation_offers;
    WHILE(counter<=numb)
    DO
    SELECT l_name,f_name,res_offer_id,count(l_name) FROM reservation_offers WHERE l_name=lastname  AND res_offer_id=counter GROUP BY f_name;
    SET counter=counter+1;
    END WHILE;
END$

