CREATE PROCEDURE inserttobranch(IN id CHAR(10),IN name VARCHAR(20),IN surname VARCHAR(20),IN salary FLOAT(7,2),IN license ENUM('A','B','C','D'),IN route ENUM('LOCAL','ABROAD'),IN experience TINYINT(4))
BEGIN
	DECLARE pos INT(11);
	DECLARE counter INT(11);
	DECLARE place INT(11);
	DECLARE smallest INT(11);
	DECLARE flag INT;
	
	DECLARE curs CURSOR FOR 
	SELECT count(wrk_br_code) FROM worker INNER JOIN driver ON wrk_AT=drv_AT GROUP BY wrk_br_code;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET flag=1;
	
	OPEN curs;
	SET flag=0;
	SET pos=0;
	SET place=0;
	SET smallest=0;
	REPEAT
		FETCH curs INTO counter;
		SET pos=pos+1;
		IF(flag=0) 
		THEN
			IF(smallest<counter)
			THEN
			SET smallest=counter;
			SET place=pos;
			END IF;
		END IF;
	
	UNTIL(flag=1)
	END REPEAT;
CLOSE curs;
END$
DELIMITER ;

