CREATE TRIGGER checkreservations
BEFORE UPDATE ON trip
FOR EACH ROW
BEGIN
    DECLARE counter INT;
  
	DECLARE id INT;
	
    IF(NEW.tr_departure<>OLD.tr_departure OR NEW.tr_return<>OLD.tr_return OR NEW.tr_cost<>OLD.tr_cost)
    THEN
		SELECT old.tr_id into id from trip where tr_id=old.tr_id;
		
		SELECT count(res_tr_id) into counter from reservation where id=res_tr_id;
        IF (counter>0)
        THEN
            SIGNAL SQLSTATE '45000' 
            SET MESSAGE_TEXT='YOU CANT UPDATE A TRIP THAT ALREADY HAS RESERVATIONS.';
        END IF;
    END IF;
END$

DELIMITER ;

